// components/BotIcon.js
import React from 'react';
import './BotIcon.css'; // Import the CSS for the bot icon

const BotIcon = () => {
    const handleClick = () => {
        // Logic to open the Q&A bot (e.g., show/hide the QnABot component)
        alert("Bot clicked!"); // Placeholder for bot interaction
    };

    return (
        <div className="bot-icon" onClick={handleClick}>
            <img src="https://example.com/bot-icon.png" alt="Bot Icon" />
        </div>
    );
};

export default BotIcon;
